<div class="adminwrappercls">
    <app-header></app-header>
    <div class="main-content-wrap">
        <mat-card class="generalcls blog" style="padding: 0 !important;">
            <mat-card-content class="adm_inner_banner testimoniallistsadmin">
                <mat-card-title class="adm_inner_title">miscellaneous</mat-card-title>
                <p class="adm_inner_para">Find Out what our Customers and Other Industry Leaders and Professionals Have
                    to Say About Our Services, Vehicles, Prices, and Other Offerings That We Bring To You.</p>
            </mat-card-content>
            <mat-card-content class="bred_cram_wrapper">
                <a mat-list-item routerLinkActive="active"> Dashboard </a>
                <a mat-list-item routerLinkActive="active"> Manage Website </a>
                <a mat-list-item routerLinkActive="active activebread" [routerLink]="'/miscellaneous'"> miscellaneous
                </a>
            </mat-card-content>
            <span class="searchblock">
                <span class="searchblockwrapper">
                    <span>
                        <h2>miscellaneous</h2>
                    </span>
                </span>
            </span>
            <div class="tablediv">


                <!-- Contact Us Listing goes here  -->
                <lib-listing *ngIf="contactUsData != null && contactUsData.length>0" [datasource]="contactUsData"
                    [skip]="contactUsData_skip" [modify_header_array]="contactUsData_modify_header"
                    [sourcedata]="tableName" [jwttoken]="user_cookie"
                    [updateendpoint]="UpdateEndpoint" [deleteendpoint]="deleteEndpoint"
                    [detail_skip_array]="detail_skip_array">
                </lib-listing>

                <!-- -------------------------------------------- -->


            </div>
        </mat-card>
    </div>
</div>
<app-footer></app-footer>
